/* Navbar */

.navbar-1 {
  padding: 5px 20px;
  position: fixed;
  width: 100vw;
  display: flex;
  justify-content: space-between;
  align-items: center;
  z-index: 3;
  transition: background-color 300ms ease;
  p {
    z-index: 4;
    color: white;
    font-weight: 500;
    margin: 0;
    font-size: 16px;
  }
  h3 {
    z-index: 4;
    color: white;
    font-weight: 500;
    margin: 0;
    font-size: 18px;
    text-decoration: none;
  }
}

.navbar-1 .sticky {
  background-color: $yellow;
}

@media(max-width: 425px) {
 .navbar-1 {
  h3 {
    display: none;
  }
}
}


.nav-back {
  min-height: 70px;
  // z-index: -1;
  background-color: $yellow;
  width: 100%;
  position: sticky;
  top:0;
  z-index: 2;
}

.nav-item {
  font-weight: bold;
  font-size: 14px;
  padding: 20px 0px;
  margin: 0px 20px;
  display: inline-block;
  position: relative;
  opacity: 0.9;
}

.nav-item:hover {
  a {
    text-decoration: none;
    color: white;
    opacity: 1;
  }
}

.nav-item::before {
  transition: 300ms;
  height: 2px;
  content: "";
  position: absolute;
  background-color: white;
}

.nav-items-ltr::before {
  width: 0%;
  bottom: 15px;
}

.nav-items-ltr:hover::before {
  width: 100%;
}

